import React from 'react';
import {Link} from 'react-router-dom';

const Header = () => {
    return(
        <div class="d-flex flex-column flex-md-row align-items-center p-3 px-md-4 mb-3 bg-white border-bottom shadow-sm">
        <h5 class="my-0 mr-md-auto font-weight-normal">React Router</h5>
        <nav class="my-2 my-md-0 mr-md-3">
            <Link className="p-2 text-dark" to="/">Anasayfa</Link>
            <Link class="p-2 text-dark" href="/hakkimizda">Hakkımızda</Link>
            <Link class="p-2 text-dark" href="/galeri">Galeri</Link>
            <Link class="p-2 text-dark" href="/iletisim">İletişim</Link>
        </nav>
        <a class="btn btn-outline-primary" href="/giris">Giriş Yap</a>
        </div>
    )
}

export default Header;
